(156, 'devenez indépendant grâce à la cryptomonnaie', '&lt;p&gt;Formation apprenez dès aujourd’hui à utiliser les cryptos, recevez tous les rudiments et devenez indépendant grâce à la cryptomonnaie.&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;font color=&quot;#000000&quot; style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;Tel: 0141227351&amp;nbsp;&lt;/font&gt;&lt;/b&gt;&lt;br&gt;&lt;/p&gt;', 'devenez-independant-grace-a-la-cryptomonnaie-156', 6, NULL, 'price_on_call', 'lindice@aventconcept.com', NULL, NULL, 'Abidjan', 'offre', 'particulier', 2, '2021-07-13 11:48:07', NULL, NULL, 86, NULL),
