(324, 'Chantilly de karite &amp; cacaco amande avocat', '&lt;div class=&quot;cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q&quot; style=&quot;overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;&quot;&gt;&lt;div dir=&quot;auto&quot; style=&quot;font-family: inherit; animation-name: none !important; transition-property: none !important;&quot;&gt;Beurre de karité offre des propriétés hydratantes incomparables  et des nutriments bénéfiques pour la peau (vitamines A, D, E F).&lt;/div&gt;&lt;/div&gt;&lt;div class=&quot;cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q&quot; style=&quot;overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;&quot;&gt;&lt;div dir=&quot;auto&quot; style=&quot;font-family: inherit; animation-name: none !important; transition-property: none !important;&quot;&gt;*Beurre de cacao a une action hydratante intense. Utilisé sur les peaux dévitalisées, le beurre de cacao apaise et nourrit. Il peut soulager certaines irritations tel que l’eczéma&lt;/div&gt;&lt;/div&gt;&lt;div class=&quot;cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q&quot; style=&quot;overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; color: rgb(228, 230, 235); font-size: 15px; background-color: rgb(36, 37, 38); animation-name: none !important; transition-property: none !important;&qu